INSERT INTO `issues` VALUES (1,'FOLDER_BELONG_SUBJECTS','Do all People belong to FOLDER','<p class=\"text-danger\">Please click \"Edit\" above the Subject photo and nominate their correct Class/Group.</p>',NULL,1,0),(2,'FOLDER_SPELL_SUBJECT','Are all People spelt correctly?','<p class=\"text-danger\">Please click \"Edit\" above the Subject photo and correct the spelling. You must correct the spelling and answer \"Yes\" to this question before proceeding.</p>',NULL,1,1),(3,'SUBJECTS_CORRECT_PHOTO','Do all People have the correct photo?','<p class=\"text-danger\">Please click \"Edit\" above the Subject photo and tag the photo as incorrect.</p>',NULL,1,0),(4,'SUBJECTS_ACCOUNTED','Are all People accounted for?','<label for=\"subject_missing_names\" class=\"form-control-label text-danger\">Please type out the names of missing People. Separate multiple names with a comma.</label><textarea class=\"form-control\" name=\"subject_missing_names\" id=\"subject_missing_names\"></textarea>',NULL,1,0),(5,'FOLDER_CORRECTED','Have all of the issues on this page been recorded for correction?','<label for=\"subject_general_issue_text\" class=\"text-danger\">Please type out any remaining issues.</label><textarea id=\"subject_general_issue_text\" name=\"subject_general_issue_text\" class=\"form-control\"></textarea>',NULL,1,0),(6,'SUBJECT_ISSUE_SPELLING','Spelling mistake in FIRSTNAME LASTNAME',NULL,NULL,2,NULL),(7,'SUBJECT_ISSUE_PICTURE','Wrong picture for FIRSTNAME LASTNAME',NULL,NULL,2,NULL),(8,'SUBJECT_ISSUE_CLASS','FIRSTNAME LASTNAME does not belong in this Class/Group.',NULL,NULL,2,NULL),(9,'SUBJECT_ISSUE_LEFT_SCHOOL','FIRSTNAME LASTNAME has left this School.',NULL,NULL,2,NULL),(10,'SUBJECT_ISSUE_JOBTITLE_SALUTATION','Add or modify the Job Title and Salutation of FIRSTNAME LASTNAME.',NULL,NULL,2,NULL),(11,'SUBJECT_ISSUE_SALUTATION','Add or modify the Salutation of FIRSTNAME LASTNAME.',NULL,NULL,2,NULL),(12,'SUBJECT_ISSUE_JOBTITLE','Add or modify the Job Title of FIRSTNAME LASTNAME